$(document).ready(function(){loadMobileData()});function loadMobileData(){var a=0;var b="R";$.getJSON("/js/rec.json",function(e){console.log("JSON Received");for(var g in e){if(!e.hasOwnProperty(g)){continue}if(a===6){getTVData();return}var c=e[g][0]["PosterURL"];var d=e[g][0]["ID"];var f=d.substr(0,1);if(d!==""){if(f==="M"){createMoviePoster(d,c,b)}else{createTVPoster(d,c,b)}}else{console.log("failed to find");continue}a+=1}}).fail(function(e,f,c){console.error("getJSON failed, status: "+f+", error: "+c)})}function getTVData(){var a=0;var b="T";console.log(b);$.getJSON("/js/tv-min.json",function(e){console.log("JSON Received");for(var f in e){if(!e.hasOwnProperty(f)){continue}if(a===6){getMovieData();return}var c=e[f][0]["PosterURL"];var d=e[f][0]["ID"];if(d!==""){createTVPoster(d,c,b)}else{console.log("failed to find");continue}a+=1}}).fail(function(e,f,c){console.error("getJSON failed, status: "+f+", error: "+c)})}function getMovieData(){var a=0;var b="M";$.getJSON("/js/movies.json",function(e){for(var f in e){if(!e.hasOwnProperty(f)){console.log("prop fail");continue}if(a===6){return}var c=e[f][0]["PosterURL"];var d=e[f][0]["ID"];if(d!==""){createMoviePoster(d,c,b)}else{console.log("failed to find");continue}a+=1}})}function createMoviePoster(f,g,c){var d=document.createElement("A");d.href="/mobile/mobile-details.html?="+f;var b=document.createElement("IMG");b.setAttribute("class","spaced hor-spaced");b.src=g;b.height=512;b.width=300;if(c==="R"){var e=document.getElementById("insert-rec")}else{var e=document.getElementById("insert-movies")}e.appendChild(d);d.appendChild(b)}function createTVPoster(f,g,c){var d=document.createElement("A");d.href="/mobile/mobile-episode-list.html?="+f;var b=document.createElement("IMG");b.setAttribute("class","spaced hor-spaced");b.src=g;b.height=512;b.width=300;if(c=="R"){var e=document.getElementById("insert-rec")}else{var e=document.getElementById("insert-tv")}e.appendChild(d);d.appendChild(b)};